import React from 'react';
import { motion } from 'framer-motion';
import { FileText, CheckCircle, TrendingUp, BarChart3, Target, ArrowLeft, Eye } from 'lucide-react';
import { Link as RouterLink } from 'react-router-dom';

const PerformanceReporting = () => {
  const features = [
    {
      icon: BarChart3,
      title: 'Detailed Ranking Tracking',
      description: 'Comprehensive tracking of your local search rankings across all target keywords and locations.'
    },
    {
      icon: TrendingUp,
      title: 'Lead Generation Metrics',
      description: 'Track call volume, website visits, and other key performance indicators that drive business growth.'
    },
    {
      icon: Eye,
      title: 'Competitor Analysis',
      description: 'Regular monitoring and analysis of competitor performance to identify opportunities and threats.'
    },
    {
      icon: Target,
      title: 'Performance Insights',
      description: 'Actionable insights and recommendations to optimize your local SEO strategy for better results.'
    },
    {
      icon: CheckCircle,
      title: 'ROI Tracking',
      description: 'Clear measurement of your investment return through detailed ROI analysis and reporting.'
    }
  ];

  const reportSections = [
    {
      title: 'Local Search Rankings',
      description: 'Track your position changes for target keywords and monitor ranking improvements over time.'
    },
    {
      title: 'Google Business Profile Performance',
      description: 'Monitor views, clicks, calls, and other key metrics from your Google Business Profile.'
    },
    {
      title: 'Website Traffic Analysis',
      description: 'Analyze organic traffic patterns and identify opportunities for improvement.'
    },
    {
      title: 'Competitor Benchmarking',
      description: 'Compare your performance against competitors and identify strategic opportunities.'
    }
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <div className="bg-gradient-to-r from-primary-900 to-primary-800 text-white">
        <div className="container mx-auto px-4 sm:px-6 lg:px-8 py-16">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
          >
            <RouterLink to="/#services" className="inline-flex items-center text-white/80 hover:text-white mb-6 transition-colors">
              <ArrowLeft className="w-4 h-4 mr-2" />
              Back to Services
            </RouterLink>
            <div className="flex items-center gap-4 mb-6">
              <div className="w-16 h-16 bg-white/20 rounded-2xl flex items-center justify-center">
                <FileText className="w-8 h-8" />
              </div>
              <h1 className="text-4xl md:text-5xl font-bold">Monthly Performance Reporting</h1>
            </div>
            <p className="text-xl text-gray-200 max-w-3xl">
              Get comprehensive insights into your local SEO performance with detailed monthly reports that show your progress and ROI.
            </p>
          </motion.div>
        </div>
      </div>

      {/* Main Content */}
      <div className="container mx-auto px-4 sm:px-6 lg:px-8 py-16">
        {/* Overview */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
          className="max-w-4xl mx-auto mb-16"
        >
          <h2 className="text-3xl font-bold text-primary-900 mb-6">Transparent Performance Tracking</h2>
          <p className="text-lg text-gray-700 leading-relaxed mb-6">
            Our comprehensive monthly reporting gives you complete visibility into your local SEO performance. 
            You\'ll see exactly how your rankings are improving, how much traffic you\'re generating, and 
            the real business impact of your local SEO investment.
          </p>
          <p className="text-lg text-gray-700 leading-relaxed">
            With detailed analytics and actionable insights, you\'ll always know where you stand and what 
            steps to take next to maximize your local search success.
          </p>
        </motion.div>

        {/* Features Grid */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-16"
        >
          {features.map((feature, index) => (
            <motion.div
              key={feature.title}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              className="bg-white rounded-2xl p-6 shadow-lg hover:shadow-xl transition-all duration-300"
            >
              <div className="w-12 h-12 bg-gradient-to-br from-primary-500 to-primary-600 rounded-xl flex items-center justify-center mb-4">
                <feature.icon className="w-6 h-6 text-white" />
              </div>
              <h3 className="text-xl font-bold text-primary-900 mb-3">{feature.title}</h3>
              <p className="text-gray-600">{feature.description}</p>
            </motion.div>
          ))}
        </motion.div>

        {/* Report Sections */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
          className="max-w-4xl mx-auto mb-16"
        >
          <h2 className="text-3xl font-bold text-primary-900 text-center mb-12">What\'s Included in Your Monthly Report</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            {reportSections.map((section, index) => (
              <motion.div
                key={section.title}
                initial={{ opacity: 0, x: -30 }}
                whileInView={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                viewport={{ once: true }}
                className="bg-white rounded-2xl p-6 shadow-lg hover:shadow-xl transition-all duration-300"
              >
                <h3 className="text-xl font-bold text-primary-900 mb-3">{section.title}</h3>
                <p className="text-gray-600">{section.description}</p>
              </motion.div>
            ))}
          </div>
        </motion.div>

        {/* Benefits */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          viewport={{ once: true }}
          className="bg-gradient-to-r from-green-50 to-blue-50 rounded-3xl p-8 md:p-12 mb-16"
        >
          <h2 className="text-3xl font-bold text-primary-900 text-center mb-8">Benefits of Monthly Reporting</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            <div className="text-center">
